import React from 'react';
import { Link } from 'react-router-dom';
import '../styles.css';

function NavBar() {
  return (
    //expand for large devices and fixed at top
     <nav class="navbar navbar-expand-lg fixed-top">              
        <button class="navbar-toggler " type="button" data-toggler="collapse" data-target="navagation-bar" onclick="myFunction()">
              <span class="navbar-toggler-icon">&#9776;</span>
        </button>
              <div class="collapse navbar-collapse" id="navigation-bar">
                  <ul class="navbar-nav ml-auto">
                    <li class="nav-item"> <a class="nav-link" href="/home">HOME</a></li>  
                    <li class="nav-item"> <a class="nav-link" href="./products">PRODUCT</a></li> 
                    <li class="nav-item"> <a class="nav-link" href="./contact">CONTACT</a></li> 
                  </ul>
              </div>
    </nav>
  )
}

function myFunction() {
  var x = document.getElementById("navigation-bar");
  x.classList.toggle('collapse')
}

export default NavBar;
